import styled from 'styled-components'
import {Navigate} from 'react-router-dom'
//import '../../../styles/log.css'

export default function Login() {

  const handleUser = async (e) => {
    e.preventDefault();
    const form = document.querySelector('form');
    const data = new FormData(form);

    const result = await fetch('http://localhost:5000/login' , 
      {
        method:'post',
        body:data
      }
    )
    const response = JSON.parse(result);
    console.log(response);
  }

  return (
    <>
    <div>
        <button className="login"><a href="/">LOGIN</a></button>
        <button className="register"><a href="/">REGISTER</a></button>
    </div>
    <Container>
        <form id="form2" >
            <input type="text" className="input" name="email"  placeholder='      Email'/>
            <input type="text" className="input"  name="password" placeholder='      Password'/>
            <button type="submit" onClick={handleUser} id="submit"  className="input">SUBMIT</button>
        </form>
    </Container>
    </>
  )
}

const Container = styled.div`
position: absolute;
width: 324px;
height: 284px;
left: 27px;
top: 268px;
left: calc(50% - 324px/2 + 0.5px);
top: calc(50% - 287.44px/2 - 0.28px);
background: #94BDE3;
border-radius: 20px;
`
